// src/components/Footer.js
import React from "react";
import "../styles/Footer.css";

function Footer() {
  const socials = [
    {
      name: "GitHub",
      logo: "https://cdn.jsdelivr.net/gh/devicons/devicon/icons/github/github-original.svg",
      link: "https://github.com/talha-xml",
    },
    {
      name: "LinkedIn",
      logo: "https://cdn.jsdelivr.net/gh/devicons/devicon/icons/linkedin/linkedin-original.svg",
      link: "https://www.linkedin.com/in/talha-faizan-46158532a/",
    },
    {
      name: "Instagram",
      logo: "https://upload.wikimedia.org/wikipedia/commons/a/a5/Instagram_icon.png",
      link: "https://www.instagram.com/not.mtf/",
    },
  ];

  return (
    <footer className="footer">
      <div className="footer-content">
        <p>
          &copy; {new Date().getFullYear()} M. Talha Faizan. All rights reserved. MyPortfolioâ„¢
        </p>

        <div className="footer-socials">
          {socials.map((item, index) => (
            <a
              key={index}
              href={item.link}
              target="_blank"
              rel="noopener noreferrer"
              className="footer-link"
            >
              <img
                src={item.logo}
                alt={`${item.name} logo`}
                className="footer-logo"
              />
            </a>
          ))}
        </div>
      </div>
    </footer>
  );
}

export default Footer;
